import React, { useRef, useEffect } from 'react';
import { Paper, Typography } from '@mui/material';
import * as d3 from 'd3';

interface AttentionSpiderWebProps {
  attention: number[][][]; // [layer][head][from_token][to_token]
  tokens: string[];
  selectedLayer: number;
  selectedHead: number;
}

interface TokenPosition {
  x: number;
  y: number;
  token: string;
  index: number;
}

const AttentionSpiderWeb: React.FC<AttentionSpiderWebProps> = ({
  attention,
  tokens,
  selectedLayer,
  selectedHead
}) => {
  const svgRef = useRef<SVGSVGElement>(null);

  useEffect(() => {
    if (!svgRef.current || !attention.length || !tokens.length) return;

    // Clear previous render
    const svg = d3.select(svgRef.current);
    svg.selectAll("*").remove();

    const width = 800;
    const height = 600;
    const centerX = width / 2;
    const centerY = height / 2;
    const radius = Math.min(width, height) / 2 - 80;

    // Safely get attention matrix for selected layer and head
    const selectedLayerAttention = attention[selectedLayer];
    if (!selectedLayerAttention) return;
    
    const selectedHeadAttention = selectedLayerAttention[selectedHead];
    if (!selectedHeadAttention || !Array.isArray(selectedHeadAttention)) return;

    // Ensure we have a 2D array structure
    const attentionMatrix = selectedHeadAttention as number[][];
    if (attentionMatrix.length === 0) return;

    // Position tokens in a circle
    const tokenPositions: TokenPosition[] = tokens.map((token, i) => {
      const angle = (2 * Math.PI * i) / tokens.length - Math.PI / 2;
      return {
        x: centerX + radius * Math.cos(angle),
        y: centerY + radius * Math.sin(angle),
        token: token,
        index: i
      };
    });

    // Create container group
    const g = svg.append('g');

    // Find maximum attention value for scaling
    let maxAttention = 0;
    for (let i = 0; i < attentionMatrix.length; i++) {
      const row = attentionMatrix[i];
      if (Array.isArray(row)) {
        for (let j = 0; j < row.length; j++) {
          if (typeof row[j] === 'number' && row[j] > maxAttention) {
            maxAttention = row[j];
          }
        }
      }
    }

    if (maxAttention === 0) return;

    const minThreshold = maxAttention * 0.05; // Only show connections above 5% of max

    // Draw attention connections
    for (let fromIdx = 0; fromIdx < attentionMatrix.length; fromIdx++) {
      const fromAttentions = attentionMatrix[fromIdx];
      if (!Array.isArray(fromAttentions)) continue;
      
      for (let toIdx = 0; toIdx < fromAttentions.length; toIdx++) {
        const attentionWeight = fromAttentions[toIdx];
        
        if (typeof attentionWeight !== 'number') continue;
        if (attentionWeight <= minThreshold) continue;
        if (fromIdx >= tokenPositions.length || toIdx >= tokenPositions.length) continue;

        const from = tokenPositions[fromIdx];
        const to = tokenPositions[toIdx];
        const opacity = attentionWeight / maxAttention;
        const strokeWidth = Math.max(1, opacity * 8);

        g.append('line')
          .attr('x1', from.x)
          .attr('y1', from.y)
          .attr('x2', to.x)
          .attr('y2', to.y)
          .attr('stroke', `rgba(33, 150, 243, ${opacity})`)
          .attr('stroke-width', strokeWidth)
          .attr('class', 'attention-connection')
          .style('pointer-events', 'none');
      }
    }

    // Draw token nodes
    const nodes = g.selectAll('.token-node')
      .data(tokenPositions)
      .enter()
      .append('g')
      .attr('class', 'token-node')
      .attr('transform', (d: TokenPosition) => `translate(${d.x}, ${d.y})`);

    // Add circles for tokens
    nodes.append('circle')
      .attr('r', 20)
      .attr('fill', '#2196F3')
      .attr('stroke', '#fff')
      .attr('stroke-width', 2)
      .style('cursor', 'pointer');

    // Add token text
    nodes.append('text')
      .text((d: TokenPosition) => d.token.length > 6 ? d.token.substring(0, 6) + '...' : d.token)
      .attr('text-anchor', 'middle')
      .attr('dy', '0.3em')
      .attr('fill', '#fff')
      .attr('font-size', '10px')
      .attr('font-weight', 'bold')
      .style('pointer-events', 'none');

    // Add hover effects
    nodes
      .on('mouseover', function(event: MouseEvent, d: TokenPosition) {
        d3.select(this).select('circle')
          .transition()
          .duration(200)
          .attr('r', 25)
          .attr('fill', '#21CBF3');
        
        // Show tooltip
        d3.select('body').append('div')
          .attr('class', 'spider-tooltip')
          .style('position', 'absolute')
          .style('background', 'rgba(0, 0, 0, 0.8)')
          .style('color', '#fff')
          .style('padding', '8px')
          .style('border-radius', '4px')
          .style('font-size', '12px')
          .style('pointer-events', 'none')
          .style('z-index', '1000')
          .style('left', (event.pageX + 10) + 'px')
          .style('top', (event.pageY - 10) + 'px')
          .text(`Token: "${d.token}" (Position: ${d.index})`);
      })
      .on('mouseout', function() {
        d3.select(this).select('circle')
          .transition()
          .duration(200)
          .attr('r', 20)
          .attr('fill', '#2196F3');
        
        d3.selectAll('.spider-tooltip').remove();
      });

    // Add center label
    g.append('text')
      .attr('x', centerX)
      .attr('y', centerY - 10)
      .attr('text-anchor', 'middle')
      .attr('fill', '#aaa')
      .attr('font-size', '14px')
      .text(`Layer ${selectedLayer + 1}, Head ${selectedHead + 1}`);

    g.append('text')
      .attr('x', centerX)
      .attr('y', centerY + 10)
      .attr('text-anchor', 'middle')
      .attr('fill', '#aaa')
      .attr('font-size', '12px')
      .text('Attention Flow Network');

  }, [attention, tokens, selectedLayer, selectedHead]);

  return (
    <Paper 
      elevation={2} 
      sx={{ 
        p: 2, 
        mb: 3, 
        bgcolor: '#1e1e1e',
        border: '1px solid #333'
      }}
    >
      <Typography variant="h6" sx={{ mb: 2, color: '#fff' }}>
        Attention Spider Web
      </Typography>
      <Typography variant="body2" sx={{ mb: 2, color: '#aaa' }}>
        Network visualization showing attention connections between tokens. 
        Line thickness and opacity represent attention strength.
      </Typography>
      <svg
        ref={svgRef}
        width="100%"
        height="600"
        viewBox="0 0 800 600"
        style={{ background: '#0a0a0a', borderRadius: '4px' }}
      />
    </Paper>
  );
};

export default AttentionSpiderWeb;
